import './App.css';

// class based componant by rcc directly
import React, { Component } from 'react'
import Navbar from './Componant/Navbar';
import NewsCom from './Componant/NewsCom';
import {

  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

export default class App extends Component {
  //IMP LINE ::: -->> In Class based componant we can define js uppar from the render function and can access props variables and function 
  // by using the (this.var) keyword
    render() {
    return (
      <div>
        <div>
            <Navbar/>
            {/* int ka liya {} or string ka liya comma */}
            <NewsCom pageSize={15} country="in" category="sports"/>
        </div>

        <BrowserRouter>
            <Routes>
                <Route exact path='/general' element={<NewsCom key="general" pageSize={15} country="in" category="general"/>}/>
                <Route exact path='/entertainment' element={<NewsCom key="entertainment" pageSize={15} country="in" category="entertainment"/>}/>
                <Route exact path='/business' element={<NewsCom key="business" pageSize={15} country="in" category="business"/>}/>
                <Route exact path='/health' element={<NewsCom key="health" pageSize={15} country="in" category="health"/>}/>
                <Route exact path='/sports' element={<NewsCom key="sports" pageSize={15} country="in" category="sports"/>}/>
                <Route exact path='/science' element={<NewsCom key="science" pageSize={15} country="in" category="science"/>}/>
                <Route exact path='/technology' element={<NewsCom key="technology" pageSize={15} country="in" category="technology"/>}/>


            </Routes> 
      </BrowserRouter>
      </div>
    )
  }
}
